selector_to_html = {"a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Battery Information<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#clear-pairing-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Clear Pairing Information<a class=\"headerlink\" href=\"#clear-pairing-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Working Mode<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>In the working area outside the range of the 2.4G receiver or Bluetooth signal, you can activate the storage mode of the scanner by following the steps described below. In this mode, all scanned data will be stored directly in the scanner. Before uploading the data, it will be permanently saved in the scanner so that you can upload the data when the scanner is in the receiving signal range.</p>", "a[href=\"faq.html#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1: The scan is successful, the buzzer sounds once, but no data is uploaded?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The scanner has entered storage mode and needs to scan <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Normal Mode</span></a> to recover.</p>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Storage Mode<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Data Upload<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Volume Settings<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scan the corresponding setting code to turn on/off the sound prompt of the scanner</p>", "a[href=\"bluetooth.html#bluetooth-keyboard-transmission-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth Keyboard Transmission Speed<a class=\"headerlink\" href=\"#bluetooth-keyboard-transmission-speed\" title=\"Link to this heading\">#</a></h2><h3>High Speed<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"bluetooth.html#bluetooth-ble\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth BLE<a class=\"headerlink\" href=\"#bluetooth-ble\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#bluetooth-spp\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth SPP<a class=\"headerlink\" href=\"#bluetooth-spp\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#ds2800-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>DS2800</strong> Wireless Scanner Quick Setup Guide<a class=\"headerlink\" href=\"#ds2800-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"wireless.html#data-upload-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Data Upload Format<a class=\"headerlink\" href=\"#data-upload-format\" title=\"Link to this heading\">#</a></h2><h3>Original Barcode Content<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#original-barcode-content1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Case Settings<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Wi-Fi Transmission mode<a class=\"headerlink\" href=\"#wi-fi-transmission-mode\" title=\"Link to this heading\">#</a></h1><h2>Modify Device ID<a class=\"headerlink\" href=\"#modify-device-id\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth Mode<a class=\"headerlink\" href=\"#bluetooth-mode\" title=\"Link to this heading\">#</a></h1><h2>Bluetooth HID<a class=\"headerlink\" href=\"#bluetooth-hid\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#modify-device-id\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modify Device ID<a class=\"headerlink\" href=\"#modify-device-id\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2:The scanner scans successfully, beeps twice, and can upload data normally. What is going on?<a class=\"headerlink\" href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The battery of the scanner gun is low and it prompts that it needs to be recharged.</p>", "a[href=\"wireless.html#data-transmission-protocol\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Data Transmission Protocol<a class=\"headerlink\" href=\"#data-transmission-protocol\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#ios-popup-hide-keyboard\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">IOS Popup/Hide Keyboard<a class=\"headerlink\" href=\"#ios-popup-hide-keyboard\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Sleep Time<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>By scanning the following setting code, you can set the scanner to enter sleep mode after a certain period of time when no code is scanned, so as to reduce power consumption.</p>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Get Firmware Version<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html#question-4-scan-successful-uploaded-data-incorrect\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 4:Scan successful, uploaded data incorrect?<a class=\"headerlink\" href=\"#question-4-scan-successful-uploaded-data-incorrect\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong></p>", "a[href=\"wireless.html#network-configuration\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Network Configuration<a class=\"headerlink\" href=\"#network-configuration\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">System Settings<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"faq.html#question-3-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3:The scanner beeps five times when a button is pressed. How can I solve this problem?<a class=\"headerlink\" href=\"#question-3-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The battery is low and needs to be charged before it can be used again.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Language<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Get Current Keyboard Language<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html#modify-bluetooth-name\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modify Bluetooth Name<a class=\"headerlink\" href=\"#modify-bluetooth-name\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Normal Mode<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Settings<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Case Settings<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#data-rceiving-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Data Rceiving Format<a class=\"headerlink\" href=\"#data-rceiving-format\" title=\"Link to this heading\">#</a></h2><h3>Voice Code<a class=\"headerlink\" href=\"#voice-code\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">FAQ<a class=\"headerlink\" href=\"#faq\" title=\"Link to this heading\">#</a></h1><h2>Question 1: The scan is successful, the buzzer sounds once, but no data is uploaded?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The scanner has entered storage mode and needs to scan <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Normal Mode</span></a> to recover.</p>", "a[href=\"bluetooth.html#bluetooth-hid\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth HID<a class=\"headerlink\" href=\"#bluetooth-hid\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
